import React, {Component} from 'react';

import Pelicula from './Pelicula';
import Slider from './Slider';
import Sidebar from './Sidebar';





class Peliculas extends Component{
	//render -> metodo obligatorio

	//array de peliculas
	state = {
		peliculas: [
			{ titulo: 'Bohemian Rhapsody', image: 'data:image/jpeg;base64,'},
			{ titulo: 'Harry Potter', image: 'data:image/jpeg;base64,'},
			{ titulo: 'El Padrino', image: 'https://media.metrolatam.com/2018/01/26/thegodfatherw900624x468.jpg'}
		],
		favorita: {}

	};

	cambiarTitulo = () => {
			
		var { peliculas } = this.state;
		/*var random = Math.floor(Math.random() * 3);
		peliculas[random].titulo = 'Titulo aleatorio cambiado';*/
		peliculas[1].titulo = 'Harry Potter y Las Reliquias de la Muerte';

		this.setState({
			peliculas: peliculas
		});
	}


	favorita = (pelicula) => {
		this.setState({
			favorita: pelicula
		});
	}

	

	render(){
		var pStyle= {
			background: 'green',
							color: 'white',
							padding: '10px'
		}

		var favorita;
		if(this.state.favorita.titulo){
			favorita = (
					<p className="favorita" style={pStyle}>
						<strong>Pelicula favorita:  </strong>
						<span>{this.state.favorita.titulo}</span>
					</p>
				);
		}else{
			favorita = (
				<p>No hay película favorita</p>
			);
		}

		return(
			<React.Fragment>
				<Slider
	        			title="Películas"
	        			size="slider-small"
	       			/>
				<div className="center">
				<div id="content" className="peliculas">
					<h2 className="subheader">Listado de películas</h2>
					<div>
					<button onClick={this.cambiarTitulo}>
						Cambiar titulo de Harry Potter
					</button>
					</div>
					{
						this.state.favorita.titulo ? (
						<p className="favorita" style={pStyle}>
						<strong>Pelicula favorita:  </strong>
						<span>{this.state.favorita.titulo}</span>
						</p>
					) : (
						<p>No hay película favorita</p>
					)
					}
					
					{favorita}

					<div id="articles" className="peliculas">
					{
						this.state.peliculas.map((pelicula, i) => {
							return(
								<Pelicula
								 key={i} 
								 pelicula={pelicula}
								 marcarFavorita={this.favorita}
								  />
							)
						})
					}
					</div>
				</div>
				<Sidebar
					blog="true"
				 />
			</div>
			</React.Fragment>
				
			);
	}
}

export default Peliculas;